import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [alimentos, setAlimentos] = useState([]);

  useEffect(() => {
    fetch('http://localhost:8000/api/alimentos/') // Asegúrate de que la URL sea correcta
      .then(response => response.json())
      .then(data => setAlimentos(data))
      .catch(error => console.error('Error:', error));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Alimentos</h1>
        <ul>
          {alimentos.map(alimento => (
            <li key={alimento.id}>{alimento.nombre}</li> // Ajusta según los campos de tu modelo
          ))}
        </ul>
      </header>
    </div>
  );
}

export default App;
